// src/components/TableGrid.js
import React, { useState } from 'react';

const TableGrid = () => {
  // Create an array with 400 elements (20x20 grid)
  const totalSquares = 400;
  const grid = new Array(totalSquares).fill(null);

  const handleClick = (index) => {
    // Log the clicked square number
    console.log(`Square ${index + 1} clicked`);
  };

  return (
    <div className="w-full h-full p-4 border border-gray-300 bg-gray-100 rounded-lg overflow-auto">
      <div className="grid grid-cols-20 gap-1">
        {grid.map((_, index) => (
          <div
            key={index}
            className="w-12 h-12 border bg-gray-200 flex items-center justify-center cursor-pointer"
            onClick={() => handleClick(index)}
          >
            <p className="text-xs">{`Table ${index + 1}`}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TableGrid;
